import kotlin.concurrent.thread

fun main() {
    fun tryDecode(data: String) {
        fun createCDR() = CDRInputStream(
            data
                .chunked(2)
                .map { it.toInt(16).toByte() }
                .toByteArray()
        ).apply {
            setLittleEndian(true)
        }

        fun getPossibleVariants(i: Int, prevOperations: List<String>, results: HashMap<String, Any>) {
            var _input: CDRInputStream = createCDR()

            val operations = mapOf(
                "ior" to { IORHelper.read(_input).type_id },
                "string" to { _input.read_string() },
//                "double" to { _input.read_double() },
                "double-array" to { _input.read_double_array(doubleArrayOf(), 0, _input.read_ulong()) },
                "ulong-array" to { _input.read_ulong_array(intArrayOf(), 0, _input.read_ulong()) },
                "ulong" to { _input.read_ulong() },
            )

            println("${"-".repeat(i)} START $i")
            for ((operation, function) in operations) {
                print("${"-".repeat(i)} NEXT $operation ")
                _input = createCDR()
                for (prevOperation in prevOperations) {
                    operations[prevOperation]!!.invoke()
                }

                try {
                    function()

                    print("success ")
                    val possibleVariations = hashMapOf<String, Any>()
                    if (_input._pos < _input.bufferCopy.size - 1) {
                        println("")
                        getPossibleVariants(i + 1, prevOperations + listOf(operation), possibleVariations)
                    }else {
                        println("final")
                    }

                    results[operation] = possibleVariations
                    break
                } catch (_: Throwable) {
                    println("failed")
                }
            }

            println("${"-".repeat(i)} END $i")
        }

        val possibleVariations = hashMapOf<String, Any>()
        getPossibleVariants(0, emptyList(), possibleVariations)

        println(possibleVariations)
    }


    
